import React from "react";
import "./Nav.css";

const Nav = () => {
    return (
        <header>
            <h1>E-sape</h1>
            <nav>
                <div>
                    <a href="#">Panier</a>
                    <a href="#">Catalogue</a>
                    <a href="#">Login</a>
                </div>
                <div>
                    <input type="text" placeholder="E-sape" />
                    <button>Panier</button>
                </div>
            </nav>
        </header>
    )
}

export default Nav;
